INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES ("2020/04/30 12:00:00", "あたしだって\nやるときはやるよ！", 10040, 0, 1, 0.0, 1, "リン", 102601, 24, 0.0, "2030/12/17 14:59:59", 0.0, 24001);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES ("2020/04/30 12:00:00", "ふぅ…\nこれであたしの仕事は\n終わりだね", 10040, 1, 1, 0.0, 1, "リン", 102601, 24, 0.0, "2030/12/17 14:59:59", 0.0, 24002);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES ("2020/04/30 12:00:00", "終わった終わった\n一人でもなんとか\nなるもんだね", 10040, 2, 1, 0.0, 1, "リン", 102601, 24, 0.0, "2030/12/17 14:59:59", 0.0, 24003);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES ("2020/04/30 12:00:00", "やったね！\nこれでようやく\nサボれるよ…", 10040, 3, 2, 0.0, 2, "リン", 102601, 24, 0.0, "2030/12/17 14:59:59", 0.0, 24004);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES ("2020/04/30 12:00:00", "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 10040, 4, 1, 0.0, 1, "リン", 102601, 24, 0.0, "2030/12/17 14:59:59", 0.0, 24005);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES ("2020/04/30 12:00:00", "あたしを敵に回した\n恐ろしさ\n思い知ったか！", 10040, 5, 2, 0.0, 2, "リン", 102601, 24, 0.0, "2030/12/17 14:59:59", 0.0, 24006);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES ("2020/04/30 12:00:00", "あたしも意外と\nやるもんでしょ？", 10040, 6, 2, 0.0, 2, "リン", 102601, 24, 0.0, "2030/12/17 14:59:59", 0.0, 24007);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES ("2020/04/30 12:00:00", "疲れた…\nねずみの逃げ足\n速すぎるよ…", 10040, 7, 4, 0.0, 4, "リン", 102601, 24, 0.0, "2030/12/17 14:59:59", 0.0, 24008);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES ("2020/04/30 12:00:00", "このままじゃ\nまっひ～に\n叱られちゃうよ", 10040, 8, 4, 0.0, 4, "リン", 102601, 24, 0.0, "2030/12/17 14:59:59", 0.0, 24009);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES ("2020/04/30 12:00:00", "まじめに\nやったんだけどな…\n悔しいな～", 10040, 9, 4, 0.0, 4, "リン", 102601, 24, 0.0, "2030/12/17 14:59:59", 0.0, 24010);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES ("2020/04/30 12:00:00", "やられた…\nねずみって意外と\nてごわいね", 10040, 10, 4, 0.0, 4, "リン", 102601, 24, 0.0, "2030/12/17 14:59:59", 0.0, 24011);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES ("2020/04/30 12:00:00", "おのれ～\nあたしのチーズを\n盗みやがって～！", 10040, 11, 4, 0.0, 4, "リン", 102601, 24, 0.0, "2030/12/17 14:59:59", 0.0, 24012);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES ("2020/04/30 12:00:00", "疲れた…\nけど、次こそは\n守り抜くよ…", 10040, 12, 1, 1.81, 4, "リン", 102601, 24, 0.0, "2030/12/17 14:59:59", 0.0, 24013);
